import React, { useState } from "react";
import styles from "styled-components";
import firebase from "../firebase.js";
import "firebase/auth";

const SignUpForm = styles.form`
    width: 80%;
    height: 235px;
    display: flex;
    flex-direction: column;
    margin: 0 auto;
`;

const InputDiv = styles.div`
    display: flex;
    margin-top: 40px;
    padding-top; 40px;
`;
const Input = styles.input`
    width: 150px;
    height: 30px;
    border: none;
    border-radius: 12px;
    background: #f2f2f2;
    box-shadow: 7px 7px 9px #d7d7d7, -7px -7px 9px #ffffff;
    margin-top: 10px;
    margin-left: 10px;
    padding-left: 10px;

    &:focus {
        outline: none;
    }
`;

const Button = styles.button`
    width: 150px;
    height: 30px;
    border: none;
    border-radius: 12px;
    background: #bff0cf;
    box-shadow: 7px 7px 9px #d7d7d7, -7px -7px 9px #ffffff;
    font-family: "Barlow Condensed", sans-serif;
    font-size: 20px;
    padding-bottom: 2px;
    margin: 40px auto;

    &:hover {
        transform: scale(1.03);
        transition: all 0.3s ease-in-out;
        cursor: pointer;
      }
    transition: all 0.3s ease-in-out;
`;

let initialFormValues = {
  email: "",
  username: "",
  password: "",
};

function SignUp() {
  const [form, setForm] = useState(initialFormValues);

  const handleSignUp = async (email, password) => {
    const auth = firebase
      .auth()
      .createUserWithEmailAndPassword(email, password)
      .then((userCredential) => {
        console.log(userCredential);
      })
      .catch((error) => {
        console.log(error);
      });

    // dispatch(setUser(login.user.displayName));
    // localStorage.setItem("user", login.user.displayName);
    // history.push("/order");
  };

  const handleChange = (ev) => {
    setForm({
      [ev.target.name]: ev.target.value,
    });
  };

  console.log(form);

  return (
    <SignUpForm onSubmit={handleSignUp}>
      <InputDiv>
        <label htmlFor="email">
          EMAIL<Input type="text" onChange={handleChange}></Input>
        </label>
        <label htmlFor="username">
          USERNAME<Input type="text"></Input>
        </label>
        <label htmlFor="password">
          PASSWORD<Input type="text"></Input>
        </label>
      </InputDiv>
      <Button>SUBMIT</Button>
    </SignUpForm>
  );
}

export default SignUp;
